const KEY = "3a4f942539cdf3dbac0716276833cf4b";
const BASE_URL = "https://api.themoviedb.org/3/movie/550";

const fetchMovies = async () => {
  const response = await fetch(`${BASE_URL}?api_key=${KEY}`);
  const data = await response.json();
  console.log(data);
  return data;
};

export { fetchMovies };
